import java.util.HashMap;
import java.util.List;
import java.util.Map;

class Solution {
    public long maximumSum(List<Integer> nums) {
        Map<String, Long> map = new HashMap<>();
        long maxSum = 0;
        for (int num : nums) {
            Map<Integer, Integer> factors = factorize(num);
            StringBuilder sb = new StringBuilder();
            for (Map.Entry<Integer, Integer> entry : factors.entrySet()) {
                if (entry.getValue() % 2 != 0) {
                    sb.append(entry.getKey()).append(",");
                }
            }
            String key = sb.toString();
            map.put(key, map.getOrDefault(key, 0L) + num);
            maxSum = Math.max(maxSum, map.get(key));
        }
        return maxSum;
    }

    private Map<Integer, Integer> factorize(int num) {
        Map<Integer, Integer> factors = new HashMap<>();
        for (int i = 2; i <= num / i; ++i) {
            while (num % i == 0) {
                factors.put(i, factors.getOrDefault(i, 0) + 1);
                num /= i;
            }
        }
        if (num > 1) factors.put(num, factors.getOrDefault(num, 0) + 1);
        return factors;
    }
}
